window.bookSummaryJSON = "<p><b>From the gutter to the stars…</b></p> <p>It's been five years since the Breakers and I got back together. Five years since we opened our club, Twisted Bullet. Five years of laughter, love, passion, and a home with each other.</p> <p>It's been the best years of my life. I wouldn't change it for the world. And yet…</p> <p>Something fundamental has been missing: performing together. So when the chance arises, we take it. How could we not? Dance is what brought us together, our first love.</p> <p>Are you ready for our encore? Then, sit back and enjoy the show.</p> <p><i>Step back into the world of Pen and her Breakers. Filled to the brim with laughter, love, tears, passion, and some of your favorite characters from the spin-off series, this is going to be one hell of a performance you won't want to miss.</i></p>"; 
